package com.bituos.bituosMonitor.Beans;


/**
 * @author dsa@bituos.com
*/

public class Counter{

	private String className;
	private String propertyName;
	private int id_counter;
	private int timeToRepot;
	
	
	public String getClassName() {
		return className;
	}
	public void setClassName(String className) {
		this.className = className;
	}
	public String getPropertyName() {
		return propertyName;
	}
	public void setPropertyName(String propertyName) {
		this.propertyName = propertyName;
	}
	public int getId_counter() {
		return id_counter;
	}
	public void setId_counter(int id_counter) {
		this.id_counter = id_counter;
	}
	public int getTimeToRepot() {
		return timeToRepot;
	}
	public void setTimeToRepot(int timeToRepot) {
		this.timeToRepot = timeToRepot;
	}

	
	


	
	
}
